import React from "react";
import { useSelector, useDispatch } from "react-redux";
import { getMoviesreducer } from "../../DataSystem/ReduxStates/slices/MovieSlice";
import {SetupData} from "../../DataSystem/ReduxStates/SetupData";
import {fetchMovies} from "../../DataSystem/ReduxStates/asyncActions";



const Home = () => {

    const dispatch = useDispatch();
    


    return (
        <div>
            <h1>Home</h1>
            <button onClick={() => dispatch(fetchMovies())}>Get Movies</button>
        </div>
    )
}

export default Home
